import React from 'react';
import '../styles/Homepage.css';

const Home: React.FC = () => {
  return (
    <section>
      <h1>Welcome to My Portfolio</h1>
        <p>Hello! I'm <strong>James Zheng</strong> a passionate software developer. Explore my portfolio to learn more about me,
          my interests, and my work! </p>
    </section>
  );
}

export default Home;
